import React from 'react';
import s from './Header.module.css';

const Header = () => {
    return <header className={s.header}>
        <img alt='logo' src='https://sun9-2.userapi.com/c5855/u800197/142241589/z_3670ba12.jpg' />
    </header>
}

export default Header;
